((w, d) => {
    w.test1 = function() {
        w.t1=imagify(d.body,(base64)=>{
            OpenInNewTab(base64);
        });
    };
    w.test2 =function(){
      w.t2=imagify({ui:d.querySelectorAll('.col-lg-6')[0],mimetype:'image/jpeg',quality:0.01},(base64)=>{
          OpenInNewTab(base64);
      })
    }
    function OpenInNewTab(url) {
      var win = window.open(url, '_blank');
      win.focus();
    }
})(window, document)
